import React from 'react'
import { NavLink } from 'react-router-dom';
import web from './2.svg';
import Common from './Common'
import Service from './Service'
const Home=()=>{
    return(
        <>
        <Common text="Grow your business with" 
        img={web}
        visit="/service"
        btnname="Get Started" />
        <Service />
        </>
    )
}
export default Home;
